Centauri.Component.Dashboard = function() {
    $("#centauricms #dashboard .accordion .panel").each(function() {
        $panel = $(this);

        $panel.find("li[data-module]").on("click", function() {
            if(!$(this).hasClass("active")) {
                $("#centauricms #dashboard .accordion .panel li.active").removeClass("active");
                $(this).addClass("active");

                var dataModule = $(this).data("module");
                Centauri.current.module = dataModule;

                $maincontent = $("#centauricms #content #maincontent");
                $maincontent.find(".content").html("");
            }
        });
    });
};

Centauri.Component.Elements = function() {
    $maincontent = $("#centauricms #content #maincontent");
    $contentelements = $maincontent.find(".content .page-detail .contentelement");

    // Initializing RTE's
    Centauri.Component.RTE();

    $contentelements.each(function() {
        $btn = $(this).find("button.toggle-edit");

        $btn.click(function() {
            $btn = $(this);

            $btn.addClass("disabled");
            $btn.toggleClass("btn-info btn-primary");
            $btn.find("i").toggleClass("fa-eye fa-eye-slash");

            $element = $(this).parent().parent().parent();
            $element.find(".bottom").slideToggle(function() {
                $btn.removeClass("disabled");
            });
        });
    });
};

Centauri.Component.Page = function() {
    $maincontent = $("#centauricms #content #maincontent");

    $pagedetail = $maincontent.find(".content .page-detail");
    $btn = $("a.btn[data-ajax='true']");

    var pid = $pagedetail.data("pid");

    $btn.click(function(e) {
        e.preventDefault();

        $btn = $(this);
        var ajaxBtnData = $btn.data("ajax-btn");
        Centauri.Component.Page.$btn = $(this);

        if(!Centauri.Component.Page.registeredAjaxs[ajaxBtnData]) {
            Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = true;

            if(ajaxBtnData == "newelement")  {
                $("#newelement-btn").removeAttr("id");
                $(this).attr("id", "newelement-btn");

                if(!$("html").hasClass("modal-newelement")) {
                    Centauri.Utility.Loader.show("maincontent");

                    $("html").addClass("modal-newelement");

                    Centauri.Utility.Ajax("Pagebutton", {
                        _token: Centauri.token,
                        pid: pid,
                        btn: "NEW_ELEMENT"
                    }, function(data) {
                        Centauri.Utility.Loader.hide("maincontent");
                        $("body").append(data);

                        Centauri.Component.RTE();
                        Centauri.Wizard.NewElement();

                        Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = false;
                    });
                } else {
                    $("#modal-newelement").modal("show");
                    Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = false;
                }
            }

            if(ajaxBtnData == "showfrontend") {
                Centauri.Utility.Ajax("Pagebutton", {
                    _token: Centauri.token,
                    pid: pid,
                    btn: "SHOW_FRONTEND"
                }, function(data) {
                    Centauri.Utility.Loader.hide("maincontent");
    
                    if(Centauri.Component.Page.winUrl != data) {
                        Centauri.Component.Page.win = null;
                    }
    
                    if(Centauri.Component.Page.win == null) {
                        Centauri.Component.Page.win = window.open(data, "_blank");
                        Centauri.Component.Page.winUrl = data;
                    }
    
                    Centauri.Component.Page.win.focus();
                    Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = false;
                });
            }

            if(ajaxBtnData == "save") {
                // Saving page itself via AJAX call
                var title = $maincontent.find("input#pagetitle").val(),
                    urlmask = $maincontent.find("input#pageurlmask").val();

                Centauri.Utility.Ajax("Pagebutton", {
                    _token: Centauri.token,
                    pid: pid,
                    btn: "SAVE",
                    type: "PAGE",

                    page: {
                        title: title,
                        urlmask: urlmask
                    }
                }, function(data) {
                    Centauri.Utility.Loader.hide("maincontent");
                    $("body").append(data);

                    Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = false;
                });

                // Saving all Content Elements through a foreach
                $contentelements = $pagedetail.find(".contentelement");
                var elementsSaved = false;

                $contentelements.each(function() {
                    $contentelement = $(this);

                    var uid = $contentelement.data("uid");
                    $fields = $contentelement.find(".field");

                    $fields.each(function() {
                        $field = $(this);

                        var value = "";
                        var field = "";

                        if($field.find("input").length) {
                            field = $field.find("input").attr("name");
                            value = $field.find("input").val();
                        }

                        if($field.find("textarea").length) {
                            field = $field.find("textarea").attr("name");
                            value = $field.find(".ck-content").html();
                        }

                        if(typeof field == "string" && typeof value == "string") {
                            // AJAX-call to save every content element inside a foreach
                            Centauri.Utility.Ajax("Pagebutton", {
                                _token: Centauri.token,
                                pid: pid,
                                btn: "SAVE",
                                type: "CONTENT_ELEMENTS",

                                element: {
                                    uid: uid,
                                    field: field,
                                    value: value
                                }
                            }, function(data) {
                                if(!elementsSaved) {
                                    elementsSaved = true;
                                    $("body").append(data);
                                }
                            });
                        }
                    });
                });
            }

            if(ajaxBtnData == "delete") {
                Centauri.Utility.Loader.hide("maincontent");
                var a = confirm("wow.");
                Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = false;
            }

            if(ajaxBtnData == "savenewelement") {
                $btn = $("#newelement-btn");

                Centauri.Utility.Loader.show("maincontent");

                $("#pages li[data-pid='" + pid + "']").trigger("click");

                var uid = 0;
                var index = $btn.data("index");

                $contentelements = $pagedetail.find(".contentelement");
                $contentelements.each(function() {
                    var ceUid = $(this).data("uid");
                    if(ceUid > uid) uid = ceUid;
                });

                $contentelement = $("#modal-newelement .contentelement.active");
                var ctype = $contentelement.data("ctype");
                $fields = $contentelement.find(".bottom .field .content");

                var fields = [];

                $fields.each(function() {
                    $field = $(this);

                    var tempField = {};

                    var value = "";
                    var field = "";

                    if($field.find("input").length) {
                        field = $field.find("input").attr("name");
                        value = $field.find("input").val();
                    }

                    if($field.find("textarea").length) {
                        field = $field.find("textarea").attr("name");
                        value = $field.find(".ck-content").html();
                    }

                    if(typeof field == "string" && typeof value == "string") {
                        tempField.field = field;
                        tempField.value = value;
                    }

                    fields.push(tempField);
                });

                $("#modal-newelement").modal("hide");

                Centauri.Utility.Ajax("Pagebutton", {
                    _token: Centauri.token,
                    pid: pid,
                    uid: uid,
                    btn: "SAVE_NEW_ELEMENT",

                    fields: fields,
                    ctype: ctype,
                    index: index
                }, function(data) {
                    $("body").append(data);
                    Centauri.Utility.Loader.hide("maincontent");

                    $("html").removeClass("modal-newelement");
                    $("#modal-newelement").remove();

                    Centauri.Component.Page.registeredAjaxs[ajaxBtnData] = false;
                });
            }
        }
    });
};

Centauri.Component.Page.win = null,
Centauri.Component.Page.winUrl = null,
Centauri.Component.Page.$btn = null;
$btn = null;

Centauri.Component.Page.registeredAjaxs = {};

// Initialization of pagetree when loading the backend
Centauri.Component.Pagetree = function() {
    // AJAX-call for getting the pagetree
    Centauri.Utility.Ajax("Pagetree", {
        _token: Centauri.token
    }, function(data) {
        $pagetree = $("#centauricms #content #pagetree");
        $pagetree.find(".content").html(data);

        Centauri.Utility.Loader.hide("pagetree");

        $("#pages").sortable({
            placeholder: "drop-placeholder",
            items: "li:not(.root)"
        });

        $pages = $pagetree.find("#pages");
        $pages.find("li").each(function() {
            $page = $(this);
            var pid = $page.data("pid");

            // Page onclick event
            $page.click(function() {
                Centauri.Utility.Loader.show("maincontent");

                $maincontent = $("#centauricms #content #maincontent");
                $crtModule = Centauri.current.module;

                if($crtModule == "home" || $crtModule == "pages") {
                    // AJAX-call for rendering the Pagedetail partial (editing elements or data of the page itself)
                    Centauri.Utility.Ajax("Pagedetail", {
                        _token: Centauri.token,
                        crtModule: $crtModule,
                        pid: pid
                    }, function(data) {
                        // Returns the Partials/Pageedit Blade (which also renders contentelements for the backend-view)
                        $maincontent.find(".content").html(data);
                        Centauri.Utility.Loader.hide("maincontent");

                        // Initializing Centauri's components (e.g. page functionalities or elements etc.)
                        Centauri.Component.Page();
                        Centauri.Component.Elements();
                    });
                }
            });
        });
    });
};

Centauri.Component.RTE = function() {
    if($(".ck.ck-reset_all.ck-body.ck-rounded-corners").length) {
        $(".ck.ck-reset_all.ck-body.ck-rounded-corners").remove();
    }

    var textareas = document.getElementsByClassName("centauri-textarea");

    for(var i = 0; i < textareas.length; i++) {
        if(!textareas[i].classList.contains("centauri-rte-initialized")) {
            textareas[i].classList.add("centauri-rte-initialized");

            ClassicEditor
            .create(textareas[i], {
                toolbar: [
                    'heading',

                    '|',

                    'bold',
                    'italic',
                    'link',

                    'bulletedList',
                    'numberedList',

                    '|',

                    'blockQuote',
                    'imageUpload',
                    'mediaEmbed',

                    '|',

                    'insertTable',

                    '|',

                    'undo',
                    'redo'
                ],

                heading: {
                    options: [
                        { model: 'paragraph', title: 'Paragraph', class: 'ck-heading_paragraph' },
                        { model: 'heading1', view: 'h1', title: 'Heading 1', class: 'ck-heading_heading1' },
                        { model: 'heading2', view: 'h2', title: 'Heading 2', class: 'ck-heading_heading2' },
                        { model: 'heading3', view: 'h3', title: 'Heading 3', class: 'ck-heading_heading3' },
                        { model: 'heading4', view: 'h4', title: 'Heading 4', class: 'ck-heading_heading4' }
                    ]
                }
            })

            .catch(error => {
                console.error(error);
            });
        }
    }
};

